import React from 'react'





const Footer = () => {

 
  return (
    <footer>
        <p>Powered by</p>
        <img  style={{ width: '100px',color: 'red', height: 'auto' /* Otros estilos */ }} src='//public/images/DH.png' alt='Logo DH' />
    </footer>
  )
}

export default Footer
